<script>
document.addEventListener("DOMContentLoaded", function () {
    const map = Object.values(window).find(v => v instanceof L.Map);
    if (!map) return;

    // Marqueurs existants
    const allLayers = Object.values(map._layers);
    allLayers.forEach(layer => {
        if (layer instanceof L.Marker && !layer._icon.classList.contains('leaflet-user-marker')) {
            if (!layer.options.customType) {
                // Inf√®re le type depuis l'ic√¥ne pour les marqueurs initiaux
                const iconUrl = layer.options.icon?.options?.iconUrl || "";
                if (iconUrl.includes("star")) layer.options.customType = "lieubonux";
                else if (iconUrl.includes("684")) layer.options.customType = "activite";
                else layer.options.customType = "hebergement";
            }
            layer.dragging?.enable?.();
        }
    });
});
</script>

<script>
document.addEventListener('DOMContentLoaded', function () {
    const panel = document.getElementById("place-manager");

    function isPopupVisible() {
        return !!document.querySelector('.swal2-container');
    }

    function isMapReady() {
        return Object.values(window).some(v => v instanceof L.Map);
    }

    function showAdminButtonIfAllowed() {
        const mode = localStorage.getItem("userMode");
        if (mode === "admin" && isMapReady() && !isPopupVisible() && panel) {
            panel.style.display = "block";
        }
    }

    // 1. Affichage auto si admin d√©j√† enregistr√©
    const watchExisting = setInterval(() => {
        if (!isPopupVisible()) {
            showAdminButtonIfAllowed();
            clearInterval(watchExisting);
        }
    }, 300);

    // 2. Affichage apr√®s validation du code
    const originalSwal = Swal.fire;
    Swal.fire = function (options) {
        const result = originalSwal.call(this, options);
        if (options && options.title === 'Acc√®s Admin ‚úÖ') {
            const check = setInterval(() => {
                if (!isPopupVisible()) {
                    showAdminButtonIfAllowed();
                    clearInterval(check);
                }
            }, 300);
        }
        return result;
    };
});

document.addEventListener('DOMContentLoaded', function () {
  const map = window.map_a986607e6179f3d79f97a641d8d3543a;
  if (!map) return;

  const markerIcons = {
    hebergement: L.AwesomeMarkers.icon({ icon: 'home', markerColor: 'purple', prefix: 'glyphicon' }),
    activite: L.icon({ iconUrl: 'https://cdn-icons-png.flaticon.com/512/684/684908.png', iconSize: [32, 32] }),
    lieubonux: L.AwesomeMarkers.icon({ icon: 'star', markerColor: 'orange', prefix: 'fa' })
  };
  const markers = [];

  function saveMarkers() {
    const data = markers.map(m => ({
      lat: m.getLatLng().lat,
      lng: m.getLatLng().lng,
      popup: m.getPopup()?.getContent() || '',
      type: m.options.customType
    }));
    localStorage.setItem("roadtrip_markers", JSON.stringify(data));
  }

  function loadMarkers() {
    const data = localStorage.getItem("roadtrip_markers");
    if (!data) return;
    JSON.parse(data).forEach(item => {
      const marker = L.marker([item.lat, item.lng], {
        icon: markerIcons[item.type],
        draggable: true,
        customType: item.type
      }).addTo(map).bindPopup(item.popup);
      marker.on('dragend', saveMarkers);
      markers.push(marker);
    });
  }

  function clearMarkerListeners() {
    markers.forEach(m => m.off("click"));
  }

  // Ajout par clic
  document.getElementById("add-marker").onclick = () => {
    Swal.fire({
  text: "Cliquez sur la carte pour ajouter un marqueur üìç",
  backdrop: false,
  customClass: { popup: 'transparent-popup' }
});

    function onMapClick(e) {
      map.off("click", onMapClick);

      Swal.fire({
  customClass: { popup: 'transparent-popup' },
  backdrop: false,
        title: 'Nouvel emplacement',
        html: `
          <label>Nom :</label><br>
          <input id='new-name' style="width: 100%; margin-bottom: 6px;" /><br>
          <label>Type :</label><br>
          <select id='new-type' style="width: 100%; margin-bottom: 10px;">
            <option value="hebergement">üè† H√©bergement</option>
            <option value="activite">üéØ Activit√©</option>
            <option value="lieubonux">üåü Lieu bonus</option>
          </select>
        `,
        showCancelButton: true,
        confirmButtonText: 'Ajouter',
        preConfirm: () => {
          return {
            name: document.getElementById("new-name").value,
            type: document.getElementById("new-type").value
          };
        }
      }).then((result) => {
        if (result.value) {
          const data = result.value;
          const marker = L.marker(e.latlng, {
            icon: markerIcons[data.type],
            draggable: true,
            customType: data.type
          }).addTo(map).bindPopup(data.name);
          marker.on('dragend', saveMarkers);
          markers.push(marker);
          saveMarkers();
        }
      });
    }

    map.on("click", onMapClick);
  };

  // Modifier un marqueur
  document.getElementById("edit-marker").onclick = () => {
    clearMarkerListeners();
    Swal.fire({
  text: "Cliquez sur un marqueur √† modifier ‚úèÔ∏è",
  backdrop: false,
  customClass: { popup: 'transparent-popup' }
});
    markers.forEach(marker => {
      marker.once("click", function () {
        const currentName = marker.getPopup()?.getContent() || '';
        const currentType = marker.options.customType || "hebergement";
        Swal.fire({
  customClass: { popup: 'transparent-popup' },
  backdrop: false,
          title: 'Modifier le lieu',
          html: `
            <label>Nom :</label><br>
            <input id='edit-name' value="${currentName}" style="width: 100%; margin-bottom: 6px;" /><br>
            <label>Type :</label><br>
            <select id='edit-type' style="width: 100%; margin-bottom: 10px;">
              <option value="hebergement">üè† H√©bergement</option>
              <option value="activite">üéØ Activit√©</option>
              <option value="lieubonux">üåü Lieu bonus</option>
            </select>
          `,
          didOpen: () => {
            document.getElementById("edit-type").value = currentType;
          },
          showCancelButton: true,
          confirmButtonText: 'Modifier',
          preConfirm: () => {
            return {
              name: document.getElementById("edit-name").value,
              type: document.getElementById("edit-type").value
            };
          }
        }).then(result => {
          if (result.value) {
            marker.setIcon(markerIcons[result.value.type]);
            marker.options.customType = result.value.type;
            marker.bindPopup(result.value.name).openPopup();
            saveMarkers();
          }
        });
      });
    });
  };

  // Supprimer un marqueur
  document.getElementById("delete-marker").onclick = () => {
    clearMarkerListeners();
    Swal.fire({
  text: "Cliquez sur un marqueur √† supprimer üóë",
  backdrop: false,
  customClass: { popup: 'transparent-popup' }
});
    markers.forEach(marker => {
      marker.once("click", function () {
        map.removeLayer(marker);
        const index = markers.indexOf(marker);
        if (index !== -1) markers.splice(index, 1);
        saveMarkers();
      });
    });
  };

  loadMarkers();
});
</script>
<script>
setTimeout(() => {

        attribution: '&copy; OpenStreetMap contributors'
      });

  base.addTo(map);

  // Active tous les groupes de calques
  const keys = Object.keys(window).filter(k => k.startsWith("feature_group_"));
  keys.forEach(k => {
    try {
      if (window[k]) map.addLayer(window[k]);

  // Coche toutes les cases dans la l√©gende
  setTimeout(() => {
    document.querySelectorAll('.leaflet-control-layers-overlays input[type=checkbox]')
      .forEach(el => el.checked = true);
  }, 1000);
}, 1000);
